import React, { useState, useRef, useEffect } from "react";
import LOGO from "../../assets/nock j.png";
import { Link } from 'react-router-dom';
import "./EmployeeAssessments.css";
import { getUserFromToken } from "../../utils/auth";

export default function EmployeeAssessments() {


function DashboardIcon() {
  return (
    <svg width="24" height="24" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
      {/* Squares with your accent colors */}
      <rect x="3" y="3" width="8" height="8" rx="1" fill="#0c0c0c" />
      <rect x="3" y="13" width="8" height="8" rx="1" fill="#0c0c0c" opacity="0.8" />
      <rect x="13" y="3" width="8" height="8" rx="1" fill="#0c0c0c" />
      <rect x="13" y="13" width="8" height="8" rx="1" fill="#0c0c0c" opacity="0.8" />

      {/* Optional center divider for more dashboard-like appearance */}
      <path d="M12 3V21" stroke="#e0e0e0" strokeWidth="1.5" />
      <path d="M3 12H21" stroke="#e0e0e0" strokeWidth="1.5" />
    </svg>
  )
}


 const [isDropdownOpen, setIsDropdownOpen] = useState(false);
  const dropdownRef = useRef(null);

  const toggleDropdown = () => {
    setIsDropdownOpen(!isDropdownOpen);
  };

  const handleClickOutside = (event) => {
    if (dropdownRef.current && !dropdownRef.current.contains(event.target)) {
      setIsDropdownOpen(false);
    }
  };

  useEffect(() => {
    document.addEventListener("mousedown", handleClickOutside);
    return () => {
      document.removeEventListener("mousedown", handleClickOutside);
    };
  }, []);

  const user = getUserFromToken();

    if (!user) {
      return "Please log in";
    }


    // Extract first letters of first and last names
  const nameParts = user.name.split(' ');
  const initials = nameParts.length >= 2
    ? `${nameParts[0][0]}${nameParts[nameParts.length - 1][0]}`
    : nameParts[0][0];

  return (
    <div className="assessments-container">
        <header className="modern-header">
        <div className="modern-logo">
          <div className="logo-placeholder">
            <img className="logo-icon" src={LOGO} alt="logo" />
            <span className="logo-text">Energizing Kenya</span>
          </div>
        </div>


         <Link  className="dashlink" to="/supDash"><DashboardIcon/>Dashboard</Link>
        <div className="modern-profile" ref={dropdownRef}>
          <div className="profile-container" onClick={toggleDropdown}>
            <div className="profile-avatar">{initials}</div>
             <div className="profile-info">
            <h3>{user.name}</h3>
            <p>{user.occupation}</p>
          </div>
            <div className={`dropdown-arrow ${isDropdownOpen ? 'open' : ''}`}>
              ‚ñº
            </div>
          </div>

          <div className={`dropdown-menu ${isDropdownOpen ? 'open' : ''}`}>
            <div className="dropdown-divider"></div>
            <Link to="/logout" className="dropdown-item logout">Log Out</Link>
          </div>
        </div>
      </header>
         <h2>Employee Assessments</h2>
      <div className="assessments-header">
        <div className="status-message">

          <p>None of your team members have submitted assessments.</p>
        </div>
      </div>

      <div className="assessments-content">
        <div className="action-card">
          <button className="view-all-btn">
            View Team Performance
            <span className="arrow-icon">‚Üí</span>
          </button>
        </div>

        <div className="filter-tabs">
          <div className="tab active">All</div>
          <div className="tab">Pending</div>
          <div className="tab">Completed</div>
        </div>

        <div className="empty-state-card">
          <div className="empty-state-content">
            <div className="empty-icon">üîç</div>
            <h3>No Assessments</h3>
            <p>Try refreshing or check back later</p>
          </div>
        </div>
      </div>
    </div>
  );
}
